import React, { Component } from 'react';


class Blog extends Component {
  render() {
    return (
      <div className="container mt-5">
      <div className="row">
        <div className="col-lg-12  mx-auto">
          <h1 className="heading">Istorija Piva</h1>
        </div>
       </div> 
      </div> 
    );
  }
}

export default Blog;
